import React from 'react';
import { Container,Row,Col } from 'react-bootstrap';
import { useSelector } from 'react-redux';
import ClientCard from './ClientCard';
import { Link } from 'react-router-dom';

const ClientList = () => {
    const clientDataSelector = useSelector(state=>state.client.clientData);
    console.log(clientDataSelector);
    return (
        <>
        <Container>
            <div className='py-2'>
                {clientDataSelector && clientDataSelector.map(client => <Col lg={3} className='my-3' key={client.Id}><Link to={`/client/${client.Id}`}><ClientCard  client={client}/></Link></Col>)}

            
            </div>
        </Container>
            
        </>
    );
}

export default ClientList;
